import React, {Component} from 'react';
import Players from './Players';
import CreationPlayer from './CreationPlayer'

class App extends Component {
	constructor(){
		super()
		this.state = {
			newPlayer: "Alucard",
			age: "666"
		}
	}

	changeText = (event) =>{
		console.log(event.target.value);
	}

	pushButton = (event) =>{
		console.log("Hello");
	}

	render(){
		return(
			<div>
				<h1>Tennis Players</h1>
				<Players />
				<CreationPlayer onChangeText={this.changeText}/>
				<h5>{this.state.newPlayer}</h5>
				<h5>{this.state.age}</h5>
			</div>
		)		
	}
}

export default App;
